import React from 'react';

const ButtonClick = () => {
  const handleClick = () => {
    alert('¡Botón clickeado!');
  };

  return (
    <div id="button-click-container" className="swipe-container">
      <button className="swipe-btn" onClick={handleClick}>
        Swipe Me
      </button>
    </div>
  );
};

export default ButtonClick;
